package advent18

import kotlinx.coroutines.Deferred
import kotlinx.coroutines.GlobalScope
import kotlinx.coroutines.async
import kotlinx.coroutines.runBlocking
import shared.AdventSolution

fun main() = object : AdventSolution(
        mapOf(
                "dabAcCaCBAcCcaDA" to "10"
        ),
        mapOf(
                "dabAcCaCBAcCcaDA" to "4"
        ),
        ""
) {
    val REPLACER = ('a'..'z')
            .joinToString("|") { c -> c.toMatchers() }
            .toRegex()

    private fun Char.toMatchers() = "$this${this.toUpperCase()}|${this.toUpperCase()}$this"

    private fun react(input: String): String {
        var previous = ""
        var changed = input

        while (changed != previous) {
            previous = changed
            changed = changed.replace(REPLACER, "")
        }
        return changed
    }

    override fun solveProblem1(input: String): String {
        return react(input).length.toString()
    }

    override fun solveProblem2(input: String): String {
        return runBlocking {
            ('a'..'z')
                .map { c -> input.reactToAsync(c) }
                .map{ it.await() }
                .minByOrNull { it.length }
                ?.length.toString()
        }
    }

    private fun String.reactToAsync(c: Char): Deferred<String> {
        val newInput = replace("$c|${c.toUpperCase()}".toRegex(), "")
        return GlobalScope.async { react(newInput) }
    }

}.solve()